import React from 'react';

export const Character = ({items, load}) => {
    return load ? (<h1> Loading...</h1>) : (<><section className="cards"> 
      {items.map(item =>(
          <h1 key={item.char_id}>{item.name}</h1>
      ))}
    </section></>)
}

export default Character;
